Resppost resppostFromJson(String str) => Resppost.fromJson(json.decode(str));
String resppostToJson(Resppost data) => json.encode(data.toJson());
class Resppost {
  Resppost({
      num code, 
      bool valid, 
      String message, 
      List<Data> data,}){
    _code = code;
    _valid = valid;
    _message = message;
    _data = data;
}

  Resppost.fromJson(dynamic json) {
    _code = json['code'];
    _valid = json['valid'];
    _message = json['message'];
    if (json['data'] != null) {
      _data = [];
      json['data'].forEach((v) {
        _data.add(Data.fromJson(v));
      });
    }
  }
  num _code;
  bool _valid;
  String _message;
  List<Data> _data;
Resppost copyWith({  num code,
  bool valid,
  String message,
  List<Data> data,
}) => Resppost(  code: code ?? _code,
  valid: valid ?? _valid,
  message: message ?? _message,
  data: data ?? _data,
);
  num get code => _code;
  bool get valid => _valid;
  String get message => _message;
  List<Data> get data => _data;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['code'] = _code;
    map['valid'] = _valid;
    map['message'] = _message;
    if (_data != null) {
      map['data'] = _data.map((v) => v.toJson()).toList();
    }
    return map;
  }

}

